import React from 'react';
import './App.css';
import { useState } from 'react';
import { useEffect } from 'react';

function App() {
const[useData, setData] = useState([])

useEffect(()=>{
  fetch('http://localhost:8000/user/')
  .then(res=>res.json())
  .then(data=>setData({useData:data}))
},[])

}
export default App
